import React, { useState, useEffect } from 'react';
import { FaPlus, FaEdit, FaTrash, FaBox, FaCalendarAlt, FaDollarSign } from 'react-icons/fa';
import Layout from '../components/layout/Layout';
import PageHeader from '../components/common/PageHeader';
import { packageApi } from '../services/api';

const Packages = () => {
  const [packages, setPackages] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchPackages();
  }, []);

  const fetchPackages = async () => {
    try {
      const response = await packageApi.getAll();
      setPackages(response.data?.data || []);
    } catch (error) {
      setError('Failed to fetch packages');
      console.error('Error fetching packages:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <Layout>
        <div className="flex items-center justify-center min-h-screen">
          <div className="loading-spinner" />
        </div>
      </Layout>
    );
  }

  if (error) {
    return (
      <Layout>
        <div className="p-4">
          <div className="bg-red-50 text-red-700 p-4 rounded-lg">
            {error}
          </div>
        </div>
      </Layout>
    );
  }

  return (
    <Layout>
      <PageHeader
        title="Safari Packages"
        description="Manage your safari tour packages"
        actions={
          <button className="btn btn-primary">
            <FaPlus className="h-4 w-4 mr-2" />
            Add Package
          </button>
        }
      />

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {packages.map((pkg) => (
          <div key={pkg.id} className="card">
            <div className="relative h-48 bg-gray-200">
              {pkg.image_url ? (
                <img
                  src={pkg.image_url}
                  alt={pkg.name}
                  className="w-full h-full object-cover"
                />
              ) : (
                <div className="flex items-center justify-center h-full">
                  <FaBox className="h-12 w-12 text-gray-400" />
                </div>
              )}
              <div className="absolute top-2 right-2 flex space-x-2">
                <button className="btn btn-sm btn-secondary">
                  <FaEdit className="h-4 w-4" />
                </button>
                <button className="btn btn-sm btn-danger">
                  <FaTrash className="h-4 w-4" />
                </button>
              </div>
              {pkg.featured && (
                <div className="absolute top-2 left-2">
                  <span className="badge badge-success">Featured</span>
                </div>
              )}
            </div>
            <div className="card-body">
              <h3 className="font-semibold text-lg mb-2">{pkg.title}</h3>
              <p className="text-gray-600 text-sm mb-4 line-clamp-2">{pkg.description}</p>
              <div className="flex items-center justify-between mb-4">
                <div className="flex items-center text-sm text-gray-500">
                  <FaCalendarAlt className="h-4 w-4 mr-1" />
                  {pkg.duration}
                </div>
                <div className="flex items-center text-sm font-medium text-green-600">
                  <FaDollarSign className="h-4 w-4" />
                  {parseFloat(pkg.price).toLocaleString()}
                </div>
              </div>
              <div className="flex flex-wrap gap-2">
                {pkg.categories && pkg.categories.map((category, index) => (
                  <span key={index} className="badge badge-info">
                    {category}
                  </span>
                ))}
              </div>
            </div>
          </div>
        ))}

        {packages.length === 0 && (
          <div className="col-span-full">
            <div className="text-center py-12 bg-white rounded-lg border-2 border-dashed border-gray-300">
              <FaBox className="mx-auto h-12 w-12 text-gray-400" />
              <h3 className="mt-2 text-sm font-medium text-gray-900">No packages</h3>
              <p className="mt-1 text-sm text-gray-500">Get started by creating a new package.</p>
              <div className="mt-6">
                <button className="btn btn-primary">
                  <FaPlus className="h-4 w-4 mr-2" />
                  Add Package
                </button>
              </div>
            </div>
          </div>
        )}
      </div>
    </Layout>
  );
};

export default Packages;
